import React from "react";
import { PageHeader, Form, Input, Card } from "antd";
import { StepPanel } from "./stepPanel";

function MyStepForm() {
  const [stepForm] = Form.useForm();

  const Step1Form = () => {
    return (
      <>
        <Form.Item
        style={{margin : "40px"}}
        name="field1"
        label="Merchant ID"
        rules={[
        //   {
        //     type: 'email',
        //     message: 'The input is not valid E-mail!',
        //   },
          {
            required: true,
            message: 'Please IMEI atau id dari POS APP',
          },
        ]}
      >
        <Input />
      </Form.Item>
      </>
    );
  };

  const Step2Form = () => {
    return (
      <>
        <Form.Item
        style={{margin : "40px"}}
        name="field2"
        label="Owner"
        rules={[
          {
            required: true,
            message: 'Nama Owner dari usaha',
          },
        ]}
      >
        <Input placeholder="Nama Owner dari usaha" />
      </Form.Item>
      </>
    );
  };
  const Step3Form = () => {
    return (
      <>
        <Form.Item name="field2" label="Field2">
          <Input />
        </Form.Item>
      </>
    );
  };

  const onFinish = (fieldsValue) => {
    const formData = stepForm.getFieldsValue();

    // POST the data to backend and show Notification
    console.log(formData);
  };

  const steps = [
    {
      title: "Step1",
      content: <Step1Form />
    },
    {
      title: "Step2",
      content: <Step2Form />
    },
    {
        title: "Step3",
        content: <Step3Form />
      }
  ];
  return (
    // <PageHeader title="Step Form" subTitle="Multi-Step form">
    <PageHeader>
      <Form form={stepForm} onFinish={onFinish}>
        <StepPanel steps={steps} />
      </Form>
    </PageHeader>
  );
}
export { MyStepForm };
